CREATE TABLE visualization_data (
    id INT PRIMARY KEY,
    value FLOAT,
    timestamp TIMESTAMP
);

CREATE TABLE user_data (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    email VARCHAR(100)
);

CREATE TABLE filter_data (
    filter_id INT PRIMARY KEY,
    filter_name VARCHAR(50),
    filter_description TEXT
);

CREATE TABLE trend_data (
    trend_id INT PRIMARY KEY,
    trend_name VARCHAR(50),
    trend_value FLOAT
);

CREATE TABLE VisualizationData (
    id INT PRIMARY KEY,
    date TIMESTAMP,
    value FLOAT
);

CREATE TABLE FilterSettings (
    id INT PRIMARY KEY,
    filter_name VARCHAR(50),
    filter_options JSON
);

CREATE TABLE UserInteractions (
    id INT PRIMARY KEY,
    user_id INT,
    interaction_type VARCHAR(50),
    interaction_time TIMESTAMP
);

CREATE TABLE VisualizationHistory (
    id INT PRIMARY KEY,
    user_id INT,
    visualization_id INT,
    view_time TIMESTAMP
);

CREATE TABLE TrendAnalysis (
    id INT PRIMARY KEY,
    trend_name VARCHAR(50),
    analysis_type VARCHAR(50),
    analysis_results JSON
);
